
import React from 'react';

interface Props {
  className?: string;
  size?: 'sm' | 'md' | 'lg' | 'xl';
}

const Logo: React.FC<Props> = ({ className = '', size = 'md' }) => {
  const sizes = {
    sm: 'w-8 h-8',
    md: 'w-12 h-12',
    lg: 'w-20 h-20',
    xl: 'w-32 h-32'
  };

  // Encodage Base64 du logo CNTSCI fourni par l'utilisateur
  const base64Logo = "data:image/png;base64,";

  return (
    <div className={`relative flex items-center justify-center shrink-0 ${sizes[size]} ${className}`}>
      <img 
        src={base64Logo} 
        alt="Logo CNTSCI" 
        className="w-full h-full object-contain"
        onError={(e) => {
          // Fallback en cas d'erreur de chargement
          (e.target as HTMLImageElement).src = 'https://api.dicebear.com/7.x/initials/svg?seed=CNTSCI&backgroundColor=ef4444';
        }}
      />
    </div>
  );
};

export default Logo;
